import React, { useState } from "react";
import { useNavigate } from "react-router-dom";
import { TextField, Button } from "@mui/material";

export default function Adminresister() {
  const [name, setName] = useState("");
  const [gmail, setGmail] = useState("");
  const [password, setPassword] = useState("");
  const [nameTouched, setNameTouched] = useState(false);
  const [gmailTouched, setGmailTouched] = useState(false);
  const [passwordTouched, setPasswordTouched] = useState(false);
  const [responseMessage, setResponseMessage] = useState("");

  const navigate = useNavigate();

  const isNameValid = name.length >= 3;
  const isGmailValid = gmail.includes("@gmail.com");
  const isPasswordValid = password.length > 6;

  const handleSubmit = async (e) => {
    e.preventDefault();
    if (!isNameValid || !isGmailValid || !isPasswordValid) {
      alert("Please fix validation errors before submitting.");
      return;
    }

    try {
      const response = await fetch("http://localhost:5000/adminresister", {
        method: "POST",
        headers: {
          "Content-Type": "application/json",
        },
        body: JSON.stringify({ name, gmail, password }),
      });

      const data = await response.json();
      setResponseMessage(data.message);

      if (data.success) {
        setName("");
        setGmail("");
        setPassword("");
        setNameTouched(false);
        setGmailTouched(false);
        setPasswordTouched(false);

        navigate("/Adminlogin");
      }
    } catch (error) {
      console.error("Error submitting data:", error);
      setResponseMessage("An error occurred. Please try again later.");
    }
  };

  return (
    <div
      style={{
        display: "flex",
        justifyContent: "center",
        alignItems: "center",
        minHeight: "100vh",
      }}
    >
      <div
        style={{
          padding: "40px",
          borderRadius: "15px",
          background: "#404040",
          boxShadow: "0 8px 32px rgba(0, 0, 0, 0.02)",
          maxWidth: "400px",
          width: "100%",
        }}
      >
        <h1 style={{ textAlign: "center", color: "#fff" }}>Admin Resister</h1>
        <form onSubmit={handleSubmit}>
          <div style={{ marginBottom: "20px" }}>
            <TextField
              fullWidth
              label="Name"
              variant="outlined"
              value={name}
              onChange={(e) => setName(e.target.value)}
              onFocus={() => setNameTouched(true)}
              error={nameTouched && !isNameValid}
              helperText={nameTouched && !isNameValid && "Name must be at least 3 characters long."}
            />
          </div>

          <div style={{ marginBottom: "20px" }}>
            <TextField
              fullWidth
              label="Gmail"
              variant="outlined"
              value={gmail}
              onChange={(e) => setGmail(e.target.value)}
              onFocus={() => setGmailTouched(true)}
              error={gmailTouched && !isGmailValid}
              helperText={gmailTouched && !isGmailValid && "Gmail must include '@gmail.com'."}
            />
          </div>

          <div style={{ marginBottom: "20px" }}>
            <TextField
              fullWidth
              type="password"
              label="Password"
              variant="outlined"
              value={password}
              onChange={(e) => setPassword(e.target.value)}
              onFocus={() => setPasswordTouched(true)}
              error={passwordTouched && !isPasswordValid}
              helperText={passwordTouched && !isPasswordValid && "Password must be more than 6 characters long."}
            />
          </div>

          <Button
            fullWidth
            type="submit"
            variant="contained"
            color="primary"
            disabled={!isNameValid || !isGmailValid || !isPasswordValid}
          >
            Submit
          </Button>
        </form>

        {responseMessage && (
          <p style={{ textAlign: "center", marginTop: "20px", color: "#fff" }}>{responseMessage}</p>
        )}
      </div>
    </div>
  );
}
